My favourite Niacinamide based Serums Available in indian market. 

@olayindia Regenerist Retinol 24 Night serum is a combination of retinoid complex & niacinamide along with minimum portion of peptides as well. If you are someone who wants to start a retinol journey, i feel this is really good option. For me personally this worked wonderfully because i am someone who has not started retinol journey as yet in my skincare because i feel my skin is too sensitive to handle it so in November 2020 i started incorporating this serum once a week & good lord my skin never felt better, this is my 2nd bottle & soon i will restock once i am done with other serums from my stash. 

@be_ilana Good skin Serum contains phyto probiotics & 3% niacinamide in it. So if you have never incorporated any actives into your skincare journey, i feel this is a really good starting point. The formula is super hydrating. If you are an oily skin person thn after using this serum you can directly go for sunscreen. I used the trial sized one in 2021 and now i have shifted to full size. 

@consciouschemistindia pore refining serum is little advanced but quite balanced formula. This contains 10% Niacinamide, Trubiom (zinc salts) & Pre+probiotics combination which makes it quite a unique formulation which makes skin super healthy and also reduces appearance of pores & helps with fading acne marks gradually. Moreover it helps with healthy skin textures. 

